import React from 'react';
import { ReactComponent as Logo } from "../../resources/images/jplogo.svg";

const AnnounceBar = () => {
    return (
        <div className="announceBar">

                <img src={Logo} alt="logo" />

        </div>
    );
};

export default AnnounceBar;
